ControlPropertyState.AutoRuleBindingString:
If(
    !IsBlank(
        LookUp(
            user_info,
            user_name = username_input.Text && password = password_input.Text
        )
    ),
    Navigate(Tabletselection) + Reset(password_input) + Set(
        username,
        username_input.Text
    ),
    Set(
        isVisible,
        true
    ) + Reset(password_input)
)
